import axios from 'axios';

function getNfts() {
  axios
    .get('https://api.elrond.com/nfts?size=10000&collection=EQUISTAR-3f393f')
    .then((res) => {
      const nfts = res.data;
      return nfts
    });
}

export { getNfts };
